/**
 * Smarty Image to data URI converter modifier plugin
 *
 * Type:     modifier<br>
 * Name:     uri<br>
 *
 * @param string $string       input string
 * @return string|void
 */
function smarty_modifier_uri($string)
{
    $mime = array(
        "gif" => "image/gif",
        "jpg" => "image/jpeg",
        "jpeg" => "image/jpeg",
        "png" => "image/png"
    );
    if(filter_var($string,FILTER_VALIDATE_URL)!==false && in_array(mb_strtolower(end(explode(".",filter_var($string,FILTER_VALIDATE_URL)))),array_keys($mime))) {
        $string = "data:".$mime[mb_strtolower(end(explode(".",filter_var($string,FILTER_VALIDATE_URL))))].";base64,".base64_encode(@file_get_contents(filter_var($string,FILTER_VALIDATE_URL)));
    }
    else {
        switch($string) {
            case "11":{ $string = "data:image/gif;base64,"; break; }
            case "12":{ $string = "data:image/gif;base64,"; break; }
            case "13":{ $string = "data:image/gif;base64,"; break; }
            case "14":{ $string = "data:image/gif;base64,"; break; }
            case "15":{ $string = "data:image/gif;base64,"; break; }
            case "21":{ $string = "data:image/gif;base64,"; break; }
            case "22":{ $string = "data:image/gif;base64,"; break; }
            case "23":{ $string = "data:image/gif;base64,"; break; }
            case "24":{ $string = "data:image/gif;base64,"; break; }
            case "25":{ $string = "data:image/gif;base64,"; break; }
            case "31":{ $string = "data:image/gif;base64,"; break; }
            case "32":{ $string = "data:image/gif;base64,"; break; }
            case "33":{ $string = "data:image/gif;base64,"; break; }
            case "34":{ $string = "data:image/gif;base64,"; break; }
            case "35":{ $string = "data:image/gif;base64,"; break; }
            case "41":{ $string = "data:image/gif;base64,"; break; }
            case "42":{ $string = "data:image/gif;base64,"; break; }
            case "43":{ $string = "data:image/gif;base64,"; break; }
            case "44":{ $string = "data:image/gif;base64,"; break; }
            case "45":{ $string = "data:image/gif;base64,"; break; }
            case "51":{ $string = "data:image/gif;base64,"; break; }
            case "52":{ $string = "data:image/gif;base64,"; break; }
            case "53":{ $string = "data:image/gif;base64,"; break; }
            case "54":{ $string = "data:image/gif;base64,"; break; }
            case "55":{ $string = "data:image/gif;base64,"; break; }
            default:{ break; }
        }
    }
    return $string;
}

